import React from 'react';


function MainFooter() {
  return ( 
        <div style={footer}>
            <div className="uk-width-1-2@s uk-width-2-5@m uk-container uk-navbar-left">
            <ul className="uk-nav uk-nav-default uuk-margin-xlarge-right">
                <li class="uk-active"><a href="#">Active</a></li>
                <li><a href="#">Item</a></li>
                <li><a href="#">Item</a></li>
            </ul>  

            <ul className="uk-nav uk-nav-default uk-margin-xlarge-right">
                <li class="uk-active"><a href="#">Active</a></li>
                <li><a href="#">Item</a></li>
                <li><a href="#">Item</a></li>
            </ul>  

            <ul className="uk-nav uk-nav-default uk-margin-xlarge-right">
                <li class="uk-active"><a href="#">Active</a></li>
                <li><a href="#">Item</a></li>
                <li><a href="#">Item</a></li>
            </ul>   
        </div>
      </div>
  );
}

const footer = {
    backgroundColor: "#F2F3F4",
    height: "200px"
}

export default MainFooter;
